import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import rainbowSDK from 'rainbow-web-sdk';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
let options = {
  rainbow: {
      host: "sandbox"
  },
  credentials: {
      login: "spongebob@mymail.sutd.edu.sg", // To replace by your developer credendials
      password: "Kr@bbyP@tty69" // To replace by your developer credentials
  },
  // Application identifier
  application: {
      appID: "82246ae05a3611eabf7e77d14e87b936",
      appSecret: "OLt1Qpu7fsCDNvT0r42waj0l4EeLe1Wb2nox0vpWGrpuqg4uunxwztDbJFAJKfwD"
  },
  // Logs options
  logs: {
      enableConsoleLogs: false,
      enableFileLogs: false,
      "color": true,
      "level": 'debug',
      "customLabel": "vincent01",
      "system-dev": {
          "internals": false,
          "http": false,
      }, 
      file: {
          path: "/var/tmp/rainbowsdk/",
          customFileName: "R-SDK-Node-Sample2",
          level: "debug",
          zippedArchive : false/*,
          maxSize : '10m',
          maxFiles : 10 // */
      }
  },
  // IM options
  im: {
      sendReadReceipt: true
  }
};
var onReady = function onReady() {
  console.log('[Hello World] :: On SDK Ready !');
};

var onLoaded = function onLoaded() {
  console.log('[Hello World] :: On SDK Loaded !');

  rainbowSDK
      .initialize('APPID', 'APPSECRET')
      .then(() => {
          console.log('[Hello World] :: Rainbow SDK is initialized!');
      })
      .catch(err => {
          console.log('[Hello World] :: Something went wrong with the SDK.', err);
      });
};
document.addEventListener(rainbowSDK.RAINBOW_ONREADY, onReady);

document.addEventListener(rainbowSDK.RAINBOW_ONLOADED, onLoaded);
rainbowSDK.start();
rainbowSDK.load();
